    }
    return (
        <div>
            <Form
            name="normal_register"
            className="register-form"
            initialValues={{
                remember: true,
            }}
            onFinish={onRegister}>
                <Form.Item
                    name="username"
                    rules={[
                    {
                        required: true,
                        message: 'A username is required',
                    },
                    ]}
                 >
                    <Input prefix={<UserOutlined className="site-form-item-icon" />} placeholder="Create Username" />
                </Form.Item>
                <Form.Item
                    name = "password"
                    rules = {[
                    {
                        required: true,
                        message: 'A password is required'
                    },
                    ]}
                >
                    <Input prefix={<UserOutlined className="site-form-item-icon" />} placeholder="Create Password" />
                </Form.Item>
                <Form.Item
                    name = "repeatpassword"
                    rules = {[
                    {
                        required: true,
                        message: 'Re-enter your password'
                    },
                    ]}
                >
                    <Input prefix={<UserOutlined className="site-form-item-icon" />} placeholder="Repeat Password" />
                </Form.Item>
                <Form.Item>
                <Button type="primary" htmlType="submit" className="register-form-button">
                Register
                </Button>
                </Form.Item>
            </Form>
        </div>
    )
}

export default Register
